};

const NodeTypeToReactComponent = new Map([
  [NodeType.AXIS_X, AxisX],
  [NodeType.AXIS_Y, AxisY],
  [NodeType.TABBAR, Tabs],
  [NodeType.BROWSER, IFrame]
]);

let layout = {
  nodeType: NodeType.AXIS_X,
  children: [
    {
      nodeType: NodeType.AXIS_Y,
      children: [
        {
          nodeType: NodeType.TABBAR,
          children: ['HTML']
        },
        {
          nodeType: NodeType.TABBAR,
          children: ['CSS', 'LESS']
        },
        {
          nodeType: NodeType.TABBAR,
          children: ['JavaScript']
        }
      ]
    },
    {
      nodeType: NodeType.BROWSER
    }
  ]
};

let preorder = (node) => {
  return React.createElement(
    NodeTypeToReactComponent.get(node.nodeType), {},
    Array.isArray(node.children) ? node.children.map(child => preorder(child)) : null
  );
}

React.render(preorder(layout), document.querySelector('.layout'));

localStorage.set('layout', JSON.stringify(layout));

